import React from 'react';
import logoImg from '../../assets/images/logo.svg';
import landingImg from '../../assets/images/landing.svg';
import studyIcon from '../../assets/images/icons/study.svg';
import givClassesIcon from '../../assets/images/icons/giv-classes.svg';

function Landing() {
    return (
        <div id="landing-page">
            <div id="landing-page-content" className="container">
                <div className="logo-container">
                    <img src={logoImg} alt="logo do site: Proffy" />
                    <h2>Sua plataforma de estudos online.</h2>
                </div>
                <img
                    src={landingImg}
                    alt="hero"
                    className="hero-image"
                />
                <div className="buttons-container">
                    <a href="" className="study">
                        <img src={studyIcon} alt="icone de estudo"/>
                        Estudar
                    </a>

                    <a href="" className="give-classes">
                        <img src={givClassesIcon} alt="icone de dar aula"/>
                        Estudar
                    </a>
                </div>
            </div>
        </div>

    )
}

export default Landing;
